prompt --application/deployment/install/install_package
begin
wwv_flow_imp_shared.create_install_script(
 p_id=>wwv_flow_imp.id(77450593691280648)
,p_install_id=>wwv_flow_imp.id(77450014221278594)
,p_name=>'Package'
,p_sequence=>10
,p_script_type=>'INSTALL'
,p_script_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'create or replace package eba_demo_sanitize is',
'    function html(',
'        p_html in clob)',
'        return    clob;',
'end eba_demo_sanitize;',
'/',
'create or replace package body eba_demo_sanitize is',
'    -- default character set for XML and XSLT documents  ',
'    c_utf8 constant integer := nls_charset_id(''UTF8'');',
'',
'    -- Return blob content of application static file, given the name',
'    function get_application_static_file(p_file_name varchar2) return blob',
'    is',
'        l_result blob;',
'    begin',
'        select blob_content',
'        into l_result',
'        from apex_application_files',
'        where flow_id = v(''APP_ID'')',
'          and filename = p_file_name;',
'        return l_result;',
'    exception',
'        when no_data_found then',
'            raise_application_error(-20001,',
'                                    ''Application static file ''||',
'                                    p_file_name||',
'                                    '' not found.'');',
'    end get_application_static_file;',
'',
'    -- Substitute XML reserved characters with equivalent XML entity references',
'    function quote_xml_reserved_chars(p_text varchar2) return varchar2 is',
'        c_ampersand constant varchar2(1) := CHR(38);',
'        c_ampersand_entity_ref constant varchar2(5) := c_ampersand||''amp;'';',
'        c_double_quote constant varchar2(1) := ''"'';',
'        c_double_quote_entity_ref constant varchar2(6) := c_ampersand||''quot;'';',
'        c_single_quote constant varchar2(1) :='''''''';',
'        c_single_quote_entity_ref constant varchar2(6) := c_ampersand||''apos;'';',
'        c_lessthan constant varchar2(1) := ''<'';',
'        c_lessthan_entity_ref constant varchar2(4) := c_ampersand||''lt;'';',
'        c_greaterthan constant varchar2(1) := ''>'';',
'        c_greaterthan_entity_ref constant varchar2(4) := c_ampersand||''gt;'';',
'        -- NOTE: Important that c_ampersand comes first in this list!',
'        c_xml_illegal_chars constant apex_t_varchar2 := ',
'            apex_t_varchar2(c_ampersand,',
'                            c_double_quote,',
'                            c_single_quote,',
'                            c_lessthan,',
'                            c_greaterthan);',
'        c_xml_illegal_chars_ent_refs constant apex_t_varchar2 := ',
'            apex_t_varchar2(c_ampersand_entity_ref,',
'                            c_double_quote_entity_ref,',
'                            c_single_quote_entity_ref,',
'                            c_lessthan_entity_ref,',
'                            c_greaterthan_entity_ref);   ',
'        l_ret varchar2(32767) := p_text;',
'    begin',
'        for i in 1..c_xml_illegal_chars.count() loop',
'            l_ret := replace(l_ret,',
'                             c_xml_illegal_chars(i),',
'                             c_xml_illegal_chars_ent_refs(i));',
'        end loop;',
'        return l_ret;',
'    end quote_xml_reserved_chars;',
'    ',
'    -- Return text surrounded by double quotes',
'    function double_quote(p_text varchar2) return varchar2',
'    is',
'        c_double_quote constant varchar2(1) := ''"'';',
'    begin',
'        return c_double_quote||p_text||c_double_quote;',
'    end double_quote;',
' ',
'    -- Return text surrounded by single quotes',
'    function single_quote(p_text varchar2) return varchar2',
'    is',
'        c_single_quote constant varchar2(1) := '''''''';',
'    begin',
'        return c_single_quote||p_text||c_single_quote;',
'    end single_quote;',
'    ',
'    -- Return name/value pair formatted appropriately to pass as XSLT param',
'    function xslt_param(p_name varchar2,p_value varchar2) return varchar2 is   ',
'        l_ret varchar2(32767);',
'    begin',
'        return p_name||''=''||double_quote(',
'                              single_quote(',
'                                  quote_xml_reserved_chars(p_value)));',
'    end xslt_param;',
'    ',
'    -- Transform the XML using XSLT stylesheet passing any bind vars as params',
'    function transform_xml( p_source_xml xmltype, ',
'                            p_stylesheet xmltype,',
'                            p_bind_vars apex_application.vc_assoc_arr) return clob',
'    is',
'        l_result clob;',
'        l_param_string varchar(4000);',
'        l_var_name varchar2(255);',
'        l_var_value varchar2(4000);',
'    begin',
'        l_var_name := p_bind_vars.first();',
'        while l_var_name is not null loop',
'            if l_param_string is not null then',
'                l_param_string := l_param_string || '' '';',
'            end if;',
'            l_var_value := p_bind_vars(l_var_name);',
'            l_param_string := l_param_string || xslt_param(l_var_name,l_var_value);',
'            l_var_name := p_bind_vars.next(l_var_name);',
'        end loop;',
'        select xmlserialize( content xmltransform(p_source_xml,',
'                                                  p_stylesheet,',
'                                                  l_param_string) as clob)',
'          into l_result',
'          from dual;',
'        return l_result;',
'    end transform_xml;',
'',
'    function to_xml(',
'        input_html clob) ',
'        return     clob',
'    is language java name ',
'    ''com.stevemuench.utils.HTMLToXHTML.toXML(oracle.sql.CLOB) return oracle.sql.CLOB'';',
'',
'    function html(',
'        p_html in clob)',
'        return    clob',
'    is',
'        l_xhtml_clob clob;',
'        l_xhtml xmltype;',
'        l_xslt  xmltype;',
'        l_output clob;',
'        l_params apex_application.vc_assoc_arr;',
'    begin',
'        -- Simplify XSLT processing by removing the default XHTML namespace that JTidy adds',
'        l_xhtml_clob := replace(to_xml(p_html),'' xmlns="http://www.w3.org/1999/xhtml"'');',
'        l_xhtml := xmltype(l_xhtml_clob);',
'        l_xslt  := xmltype(get_application_static_file(''sanitize-html.xsl''),c_utf8);',
'        l_output := transform_xml(l_xhtml,l_xslt,l_params);',
'        return l_output;',
'    end html;',
'',
'end eba_demo_sanitize;',
'/'))
);
